import React from 'react';
import "./User.css";

const User = props => {
    const usersData = props.items;
    let count = 1;
    const artistData = usersData.map((artist) =>
            <div className="artistDiv">
                <button onClick={() => props.handleClick("artists")}> click for artists</button>
                <div className="text">
                    <h1 className="count" >#{count++}</h1>
                    <h1 className="artistName">{artist.name}</h1>
                </div>
                <div className="imageDiv">
                    <a href={artist.external_urls.spotify} target="_blank" rel="noopener noreferrer">
                        <img src={artist.images[0].url} alt="artist" className="image"/>
                    </a>
                </div>
            </div>
    ) 
    return (
        <div className="section">
            <h1>Your Top 10 Favorite Artist</h1>
            {artistData}
        </div>
    )
}
export default User;
